sources.sass/_variables.scss:
$text-color-chery: #d41443;
$text-color-rose: #ffa5ba;
$text-color-white: #ffffff;
$text-color-blue: #2196f3;
$text-button-chery: #d41443;
$background-hero-hover: #c7133e;
$background-hero-hover2: #ecebeb;
$background-hero-rose: #ffa5ba;
$background-products-rose: #ffb8ca;
$background-products-cofe: #f0d1a5;
$background-products-green: #c2e297;
$main-backround-rose: #fff5f6;
$text-black: #000;
$mobile: 320px;
$tablet: 768px;
$desktop: 1200px;
$animation-time: 250ms;
$animation-type: linear;
img {
  display: block;
  max-width: 100%;
  height: auto;
}

a {
  text-decoration: none;
}

ul {
  margin: 0;
  padding: 0;
  list-style: none;
}

p {
  margin: 0;
  padding: 0;
}

sources.sass/_header.scss:
.page-header {
  position: absolute;
  top: 0;
  left: 50%;
  transform: translate(-50%);
  z-index: 11;
  width: 100%;
  overflow: hidden;
  @media screen and (min-width: 1200px) {
    padding-top: 30px;
  }
}

.page-header.is-hidden {
  height: 100vh;
}

.container-desktop {
  @media screen and (min-width: 1200px) {
    position: absolute;
    top: 0;
    left: 45px;
  }
}

.header-nav-list {
  @media screen and (min-width: 1200px) {
    display: flex;
    align-items: center;
  }

  @media screen and (max-width: 1199px) {
    margin-top: 19px;
  }
}

.header-nav-link.curent {
  color: $text-color-chery;
}

.header-nav-title {
  @media screen and (max-width: 1199px) {
    &:nth-child(1) {
      border-top: 1px solid #e18298;
    }
    border-bottom: 1px solid #e18298;
  }

  @media screen and (min-width: 1200px) {
    & + & {
      margin-left: 35px;
    }
  }
}

.header-nav-link {
  font-family: DM Sans;
  font-style: normal;
  font-weight: 700;
  font-size: 16px;
  line-height: 1.31;

  color: $text-color-white;
  display: block;
  @media screen and (max-width: 1199px) {
    padding: 11px 20px 13px;
  }

  @media screen and (min-width: 1200px) {
    padding-top: 21px;
    padding-bottom: 21px;
  }

  &:hover,
  &:focus {
    color: $text-color-chery;
  }

  transition: color $animation-time $animation-type;
}

.page-header-btn-tablet {
  display: none;
  padding: 0 36px;
  min-width: 160px;
  height: 44px;

  font-family: DM Sans;
  font-weight: 700;
  font-size: 16px;
  line-height: 1.31;

  color: $text-button-chery;

  border-radius: 22px;
  border: transparent;
  background-color: $text-color-white;

  &:hover,
  &:focus {
    box-shadow: 0 0 5px 0 $text-color-rose inset, 0 0 2px 5px $text-color-rose;
    outline: none;
    background-color: $background-hero-hover2;
  }

  transition: background-color $animation-time $animation-type;

  @media screen and (min-width: $tablet) and (max-width: 1199px) {
    display: block;
    margin-left: 30px;
  }
}

.page-header-btn {
  @media screen and (max-width: 1199px) {
    margin-left: auto;
    margin-right: auto;
    margin-top: 60px;
    padding: 0 49px;
    min-width: 209px;
  }
  display: block;

  margin-left: 50px;
  width: 160px;
  height: 44px;

  font-family: DM Sans;
  font-weight: 700;
  font-size: 16px;
  line-height: 1.31;

  color: $text-button-chery;

  border-radius: 22px;
  border: transparent;
  background-color: $text-color-white;

  cursor: pointer;

  &-icon {
    margin-left: 14px;
  }

  &:hover,
  &:focus {
    background-color: $background-hero-hover2;
    box-shadow: 0 0 5px 0 $text-color-rose inset, 0 0 2px 5px $text-color-rose;
    outline: none;
  }

  transition: background-color $animation-time $animation-type;
}

// Меню мобильное

.container.mobile {
  position: relative;
}

.menu-mobile {
  pointer-events: all;
  @media screen and (min-width: $tablet) and (max-width: 1199px) {
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding-top: 38px;
  }
}

.menu-mobile-nav {
  @media screen and (min-width: $tablet) and (max-width: 1199px) {
    display: flex;
    align-items: center;
    margin-left: auto;
  }
}

.menu-mobile-btn {
  display: none;
  @media screen and (max-width: 1199px) {
    @media screen and (max-width: 767.98px) {
      position: absolute;
      z-index: 3;
      top: 15px;
      right: 20px;
    }
    display: flex;
    justify-content: center;
    align-items: center;

    padding: 0;
    border: transparent;
    background-color: transparent;
    width: 30px;
    height: 30px;

    &:hover,
    &:focus {
      outline: 0;
      outline-offset: 0;
    }

    &.is-open {
      position: absolute;
      z-index: 3;
      top: 15px;
      right: 20px;
    }

    &.is-open .menu-mobile-icon-burger {
      opacity: 0;
    }

    & .menu-mobile-icon-close {
      opacity: 0;
    }

    &.is-open .menu-mobile-icon-close {
      opacity: 1;
      transition: opacity $animation-time $animation-type $animation-time;
    }
  }
}

.menu-mobile-container {
  display: flex;
  flex-direction: row-reverse;
  align-items: center;

  @media screen and (max-width: 1199px) {
    opacity: 0;
    position: absolute;
    top: 0;
    right: 0;
    z-index: 2;
    width: 250px;
    height: 100vh;

    pointer-events: none;
    overflow: hidden;

    background-color: #e17992;

    transform: translateX(100%);
  }

  &.is-open {
    @media screen and (max-width: 1199px) {
      display: block;
      opacity: 1;
      pointer-events: all;

      transform: translateX(0);
    }
  }

  transition: opacity $animation-time $animation-type,
    transform $animation-time $animation-type;
}

