// .ice-cream-box
.hero-png-box {
  &__img {
    position: absolute;
    left: 47%;
    bottom: 0;
    z-index: -2;
    animation-name: slideInUpIce;
    animation-duration: 1s;
    animation-fill-mode: both;
  }
  &__circle {
    top: 50%;
    left: 50%;
    transform: translate(-35%, -55%);
    position: absolute;
    z-index: -3;
    background-color: $background-hero-rose;
