@keyframes slideInUpIce {
  0% {
    -webkit-transform: translateY(100%);
    transform: translateY(100%);
    visibility: visible;
  }
  100% {
    -webkit-transform: translateY(0);
    transform: translateY(0);
  }
}

// правый вверх
.hero-info-right-box {
  display: none;
  @media screen and(min-width: $tablet) {
