  margin-bottom: 43px;
  text-align: right;
  margin-right: 20px;
  @media (min-width: 720px) {
    margin-right: 36px;
  }
  @media (min-width: 1280px) {
    margin-right: 121px;
  }
}

.footer_icon-container {
  display: flex;
  justify-content: flex-end;
}

.footer_social-link {
  display: flex;
  justify-content: center;
  align-items: center;

  width: 34px;
  height: 34px;
  border-radius: 50%;
  background-color: $text-color-rose;

  @include transit(background-color);

  &:hover,
  &:focus {
    background-color: $text-color-chery;
  }
  @media (min-width: 720px) {
    width: 36px;
    height: 36px;
  }
}

.footer_icon {
  width: 20px;
  height: 20px;
}

.footer_li {
  margin-left: 28px;
}

.footer_contact {
  margin-top: 46px;
}

.footer_contact-text {
  font-family: DM Sans;
  font-style: normal;
  font-weight: bold;
  font-size: 12px;
  line-height: 186%;
  /* or 22px */

  text-align: right;

  color: $text-black;

  @media (min-width: 720px) {
    font-size: 14px;
  }
  @media (min-width: 1280px) {
    font-size: 16px;
  }
}

.footer_contact-num {
  color: $text-button-chery;
  font-family: DM Sans;
  font-style: normal;
  font-weight: bold;
  font-size: 12px;
  line-height: 186%;
  /* or 22px */

  text-align: right;
  @media (min-width: 720px) {
    font-size: 14px;
  }
  @media (min-width: 1280px) {
    font-size: 16px;
  }
}

.footer_watermark-container {
  margin: 0 auto;
  width: 150px;
  @media (min-width: 720px) {
    width: 276px;
  }
}

.footer_watermark-text {
  font-family: DM Sans;
  font-style: normal;
  font-weight: bold;
  font-size: 14px;
  line-height: 152%;
  /* or 21px */

  text-align: center;

  color: #907e82;
}

.line {
  margin-bottom: 20px;
  width: 100%;
  border-top: 1px solid #e1e1e1;
  @media (min-width: 720px) {
    margin-bottom: 29px;
  }
  @media (min-width: 1280px) {
    margin-bottom: 9px;
  }
}

sources.sass/_container.scss:
.container {
  padding-left: 20px;
  padding-right: 20px;
  margin-left: auto;
  margin-right: auto;

  @media screen and (min-width: 768px) {
    padding-left: 34px;
    padding-right: 34px;
  }

  @media screen and (min-width: 1200px) {
    padding-left: 115px;
    padding-right: 115px;
  }


  @media screen and (max-width: 320px) and (min-width: 480px) {
    width: 320px;
  }

  @media screen and (min-width: 768px) {
    width: 768px;
  }
  @media screen and (min-width: 1200px) {
    width: 1200px;
  }
}
